import { ReactComponent as Shape } from "../assets/shape.svg";
import "../css/login.css";
const Login = () => {
  return (
    <div className="container col">
      <div className="say">
        <Shape />
        <div>Welcome Back!</div>
        <div>Lets help you meet your tasks</div>
      </div>
    </div>
  );
};
export default Login;
